import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';

import './About.css';
// import AboutPic from './about.png';
import AboutPic from './about_lighter.png';

export default props => {
    return(
        <div className="about-pg">
            <Container>
                <Row>
                    <Col xs={12} sm={12} md={4} lg={4}>
                        <img src={AboutPic} className="about-polaroid" />
                        <br/>
                        <p className="about-links">
                            <a href="https://www.github.com/lichellegaerlan" target="_blank">Github</a> / <a href="https://www.linkedin.com/lichellemaegaerlan" target="_blank">LinkedIn</a>
                        </p>
                    </Col>

                    <Col xs={12} sm={12} md={4} lg={4}>
                        <h1>bio</h1>
                    </Col>

                    <Col xs={12} sm={12} md={4} lg={4}>
                        <h2>goals</h2>
                    </Col>
                </Row>

            </Container>
        </div>
    );
}
